import React, { useState } from "react";
import { RouteComponentProps, useLocation } from "react-router";
import profilePic from "./images/profile/2602017071517530029820170521192154199Screenshot_2016-05-29-20-10-52_1.jpg";
import MoreVertIcon from "@material-ui/icons/MoreVert";

import SuperstarzIconLight from "./images/ssmall.png";
import SuperstarzIconDark from "./images/sdsmall.png";
import {
  useTheme,
  Paper,
  useMediaQuery,
  Grid,
  Typography,
  makeStyles,
  createMuiTheme,
  MuiThemeProvider,
} from "@material-ui/core";

interface stateType {
  userdata: { username: string; usercolor: string; userimage: string };
}

function Supercheck() {
  const [darkmode, setDarkmode] = useState<boolean>(false);
  interface IappVariables {
    shade: string;
    shade2: string;
    shade2num: string;
    shade2nump: string;
    logoimage: string;
    secondarymaincolor: string;
    maincolor: string;
    shade2nump22: string;
  }

  var appVariables: IappVariables = {
    shade: "",
    shade2: "",
    shade2num: "",
    shade2nump: "",
    logoimage: "",
    secondarymaincolor: "",
    maincolor: "",
    shade2nump22: "",
  };

  var appVariablesDARK: IappVariables = {
    shade: "#cccccc",
    shade2: "#cccccc",
    shade2num: "1.1",
    shade2nump: "1.8",
    logoimage: SuperstarzIconDark,
    secondarymaincolor: "#ccccccff",
    maincolor: "#ccccccff",
    shade2nump22: "5.5",
  };

  var appVariablesLIGHT: IappVariables = {
    shade: "#0b111b",
    shade2: "#0b111b",
    shade2num: "1.5",
    shade2nump: "1.5",
    logoimage: SuperstarzIconLight,
    secondarymaincolor: "#0b111b",
    maincolor: "#0b111b",
    shade2nump22: "8",
  };

  if (darkmode) {
    appVariables = appVariablesDARK;
  } else {
    appVariables = appVariablesLIGHT;
  }

  let themeGeneralSettings = createMuiTheme({
    palette: {
      primary: {
        main: `${appVariables.maincolor}`,
      },
      secondary: {
        main: `${appVariables.secondarymaincolor}`,
      },
      type: darkmode ? "dark" : "light",
    },
  });

  var useStyle = makeStyles((themeGeneralSettings) => ({
    optionsContainer: {
      [themeGeneralSettings.breakpoints.up("xs")]: {
        padding: "3vh",
        top: "1em",
        fontWeight: "bold",
        display: "flex",
        alignItems: "center",
      },
      [themeGeneralSettings.breakpoints.up("sm")]: {
        padding: "4.5vh",
        top: "1em",
        fontWeight: "bold",
        display: "flex",
        alignItems: "center",
      },
    },
  }));

  var classes = useStyle();

  const { state } = useLocation<stateType>();
  console.log(state.userdata);
  return (
    <MuiThemeProvider theme={themeGeneralSettings}>
      <Paper>
        <Grid
          xs={12}
          container
          style={{
            padding: "5px",
            paddingRight: "10px",
            position: "absolute",
            top: "0em",
            fontFamily: "kaushan_scriptregular",
            transition: "opacity 1.5s",
            display: "flex",
          }}
        >
          <Grid
            xs={12}
            item
            style={{
              fontFamily: "kaushan_scriptregular",
              fontSize: "2.41vw",
              fontWeight: "bolder",
              display: "flex",
              alignItems: "center",
              justifyContent: "flex-end",
            }}
          >
            <img
              style={{
                objectFit: "contain",
                width: "4.8%",
              }}
              src={SuperstarzIconLight}
              alt="SuperstarZ logo"
            />
          </Grid>
        </Grid>

        <Grid xs={12} style={{ height: "100vh" }}>
          <Grid
            xs={12}
            className="center-content-vertically"
            style={{
              zIndex: 1,
              width: "100%",
              backgroundColor: "#00ccff",
              display: "grid",
              position: "absolute",
              height: "0px",
            }}
          >
            <DIV
              xs={12}
              style={{
                position: "relative",
                margin: "auto",
                left: "-11.5%",
                top: "-26vh",
                backgroundColor: "green",
                height: "80px",
                width: "80px",
                borderRadius: "50%",
                textAlign: "center",
                alignItems: "center",
                display: "grid",
                justifyContent: "center",
              }}
            >
              {" "}
              <MoreVertIcon style={{ fontSize: "3.8rem" }} />
            </DIV>
          </Grid>
          <Grid
            xs={12}
            className="center-content-vertically"
            style={{
              cursor: "pointer",
              zIndex: 0,
              width: "100%",
              display: "grid",
              position: "absolute",
            }}
          >
            <img
              style={{
                position: "relative",
                objectFit: "contain",
                width: "30%",
                borderRadius: "200px",
                margin: "auto",
              }}
              src={profilePic}
              alt="SuperstarZ logo"
            />
          </Grid>
        </Grid>
      </Paper>
    </MuiThemeProvider>
  );
}

export default Supercheck;
